import React from 'react'
import AddIcon from '@mui/icons-material/Add';
import { Button } from '@mui/material';

const Header = () => {
  return (
    <div className='text-2xl flex justify-between items-center font-bold text-red-500 p-3 border-b-2 border-gray-500'>
       <span>Filmy<span className='text-white'>Web</span></span>
       <h1 className='text-lg text-white cursor-pointer flex items-center'>
        <Button className='text-white'><AddIcon className='mr-1' color='inherit'/>Add New</Button></h1>
    </div>
  )
}

export default Header;
